INSERT INTO `itens` VALUES (1,'','R$ 2.899,99','\nAsus MD15 um dos menores notebooks de 15 polegadas do mundo\nSeja para trabalho ou lazer, o ASUS M515 é um notebook que oferece desempenho poderoso e visuais envolventes. Sua tela NanoEdge possui um revestimento antirreflexo fosco para uma experiência verdadeiramente envolvente. O M515 é equipado com até processador AMD Ryzen e memória de 8 GB. Armazenamento rápido com SSD com até 256GB PCIe SSD.\n\nMais velocidade no seu dia a dia\nO ASUS M515 possui armazenamento SSD, que além de ser muito mais rápido que o HD convencional, é menor, mais leve e não tem partes mecânicas extremamente sensíveis a impactos e solavancos. Isso garante maior proteção aos dados armazenados no seu notebook, para que você possa trabalhar sem preocupações, com alto desempenho e produtividade, mesmo em um veículo em movimento.\n\nRápido e eficiente\nCom processadores até SérioAMD Ryzen com 8 GB de memória, o ASUS M515 ajuda você a fazer as coisas com rapidez e eficiência.\n\nTenha uma visão mais ampla do mundo\nA tela NanoEdge dá ao ASUS M515 uma vasta área de tela para uma experiência de visualização envolvente seja para o trabalho ou lazer. Com tela FHD de visão ampla apresenta um revestimento antirreflexo para reduzir distrações indesejadas de reflexos irritantes, para que você possa realmente se concentrar no que está à sua frente.\n','Notebook Asus AMD Ryzen 5-3500U, 8GB RAM, SSD 256GB, 15,6\', Radeon Vega 8, Windows 11 Home, Cinza - M515DA-BR1213W',2),(2,'','R$ 1.999,00','\n\nSmartphone Samsung Galaxy S20 FE 5G 128GB\n \nEste é o smartphone para pessoas que querem tudo. Ouvimos vocês, os fãs, e agora não precisam mais ficar em dúvida sobre o que escolher. Este é o smartphone feito sob medida para fãs de todos os tipos. Então, se você é fã de fotografia, jogos ou adora deixar seu feed repleto de tudo que o inspira, nós reunimos a combinação definitiva de inovação S20. Este é o smartphone que oferece o que você deseja, para você fazer mais daquilo que ama.\n\nA Câmera de Lente Tripla de Nível Profissional\nA câmera de lente tripla de nível profissional permite que você tire aquela foto profissional digna de #semfiltro com facilidade. Enquadre a cena com a câmera wide e, a seguir, mostre ainda mais com a câmera ultra-wide, ou aumente o zoom com o zoom óptico de 3x na câmera teleobjetiva.\n\nConectividade\nO LTE de até 1,6 Gbps oferece velocidades de dados poderosas, enquanto o Wi-Fi 6 conecta você com segurança e baixa latência, mesmo em um local lotado. Portanto, quer você esteja conectado a LTE ou Wi-Fi, pode jogar em tempo real com pouco atraso.\n\nBateria Inteligente o Dia Todo para que Você possa Jogar por Horas\nViva sua vida sem se preocupar com onde você pode conectar seu smartphone. A bateria de 4500mAh (padrão) dá ao seu smartphone a energia necessária para durar mais que o seu dia, e é inteligente o suficiente para economizar energia para quando você realmente precisar.\n \nEspaço para Milhares de Fotos e Vídeos\nCom 128 GB integrados e a capacidade de armazenar até 1 TB (não incluso) a mais em um cartão microSD, o único limite para o que você pode armazenar é o que você pode criar e baixar.\n\n','Smartphone Samsung Galaxy S20 FE 5G, 6GB RAM, Snapdragon 865, 128GB, Octa Core, Câmera Tripla 32MP, Tela Infinita 6.5, Azul Marinho - SM-G781BZBRZTO',3),(3,'','R$ 1.299,99','A TGC12 ThunderX3 é uma cadeira gamer com revestimento de Poliuretano (PU) coberta com costuras de fibra de carbono. Seu estofado é em forma de diamantes construída com firmeza para proporcionar conforto enquanto você desfruta do prazer de jogar seus games favoritos. Da sala de estar para a sala de jogos, você pode planejar a próxima dominação do mundo do conforto de sua cadeira gamer.','Cadeira Gamer ThunderX3 TGC12, Black',5),(4,'','R$ 4.499,90','\nConsole Sony Playstation 5\n \nJogar no PS5 Não Tem Limites\nDesfrute do carregamento do seu PS5, extremamente rápido com o SSD de altíssima velocidade, uma imersão mais profunda com suporte a feedback tátil, gatilhos adaptáveis e áudio 3D, além de uma geração inédita de jogos incríveis para PlayStation.\n\nVeloz como um raio, SSD ultrarrápido\nDomine o poder de uma CPU e GPU personalizadas e o SSD com E/S integradas que redefinem as regras do que o console PlayStation pode fazer.\n\nMaximize suas sessões de jogo com tempo de carregamento praticamente instantâneo para jogos do PS5 instalados.\n\nJogos impressionantes para PS5\nMaravilhe-se com os gráficos incríveis e experimente os recursos do novo PS5. \'Ray Tracing\' (Rastreamento de raios) Mergulhe em mundos com um nível inédito de realismo enquanto os raios de luz são simulados individualmente, criando sombras e reflexos realistas em jogos compatíveis com Playstation 5. Jogos para TVs 4K Curta seus jogos favoritos do PS5 na sua incrível TV 4K. Até 120 fps com saída em 120 Hz Desfrute da fluidez e taxa de quadros de até 120 fps em jogos compatíveis, com suporte a saída de 120 Hz em telas 4K.\n\nTecnologia HDR\nCom uma TV HDR, os jogos compatíveis do PS5 exibem uma variedade de cores inacreditavelmente vibrantes e realistas. Saída em 8K Os consoles PS5 oferecem suporte à saída 8K, para que você possa jogar na sua tela com resolução de 4320p.\n\nTempest 3D AudioTech\nMergulhe em palcos sonoros que farão você acreditar que os sons estão vindo de todas as direções. Seja com seus fones de ouvido ou os alto-falantes de sua TV, seu ambiente ganhará vida com o Tempest 3D AudioTech em jogos compatíveis.\n\nResposta tátil\nExperimente a resposta tátil com o controle sem fio DualSense em jogos selecionados do PS5 e sinta o impacto de suas ações no jogo através da resposta sensorial dinâmica.\n\nGatilhos adaptáveis\nAssuma o controle com os imersivos gatilhos adaptáveis, agora com níveis dinâmicos de resistência que simulam o impacto físico das atividades em jogos selecionados do PS5.\n\n','Console Sony Playstation 5',4),(5,'','R$ 179,99','\nHeadset Gamer HyperX Cloud Stinger\n \nFaça parte da família Cloud da HyperX com o headset Cloud Stinger!\nCompleta e versátil, a linha de headsets Cloud foi projetada para as necessidades de qualquer nível de jogador. Independente do seu sistema, estilo de jogo e características este headset irá te surpreender. O Cloud Stinger é um modelo licenciado oficialmente pela Xbox, perfeito para jogadores de Xbox One! Conforto, tecnologia e design a sua altura.\n\nHyperX confortável para todo tipo de rosto\nOs fones de ouvido giram 90° e ficam bem apoiados confortavelmente em torno do pescoço durante os intervalos de batalhas. Como todo headset HyperX, possui a tecnologia premiada da espuma memory foam. Além do conforto, a qualidade do som é impecável! Este modelo possui drivers de 50mm que oferecem qualidade de som impecáveis com precisão de áudio e garantindo sua imersão no jogo. Ainda para seu conforto possui controles em aço de alta qualidade são projetados para longa durabilidade e estabilidade, se ajustando perfeitamente.\n\nSom imersivo para você se sentir no jogo com o Headset HyperX\nPossui também controle deslizante de volume para sua comodidade. Ele está localizado na parte inferior do fone de ouvido direito. Seu microfone tem cancelamento de ruído que gira para ser silenciado. Também com ruído passivo integrado que reduz o ruído de fundo para uma melhor qualidade de voz em seus jogos multiplayer. Um dos seus diferenciais também é sua leveza, um headset leve e com toda a tecnologia que você precisa.\n','Headset Gamer HyperX Cloud Stinger, Drivers 50mm, Múltiplas Plataformas, P2 e P3 - HX-HSCS-BK/NA',7),(6,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10ª Geração oferecem atualizações de desempenho incríveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimização de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que você faz, direcionando potência dinamicamente para onde ela é mais necessária. Os processadores Intel Core da 10ª Geração com memória Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10ª Geração oferecem conectividade cabeada e sem fio rápida, garantida e versátil.\n\nEntretenimento premium \nUma nova arquitetura de gráficos oferece suporte a experiências visuais ultravívidas, como vídeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10 ª Geração com gráficos Intel Iris Plus permitem experiências de entretenimento nunca vistas.\n\nJogos sérios (serious gaming) \nAproveite jogos incríveis com alto FPS, até mesmo enquanto realiza streaming e gravação. Turbo e aceleração da memória Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10ª Geração capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vídeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6),(7,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10ª Geração oferecem atualizações de desempenho incríveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimização de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que você faz, direcionando potência dinamicamente para onde ela é mais necessária. Os processadores Intel Core da 10ª Geração com memória Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10ª Geração oferecem conectividade cabeada e sem fio rápida, garantida e versátil.\n\nEntretenimento premium \nUma nova arquitetura de gráficos oferece suporte a experiências visuais ultravívidas, como vídeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10 ª Geração com gráficos Intel Iris Plus permitem experiências de entretenimento nunca vistas.\n\nJogos sérios (serious gaming) \nAproveite jogos incríveis com alto FPS, até mesmo enquanto realiza streaming e gravação. Turbo e aceleração da memória Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10ª Geração capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vídeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6),(8,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10ª Geração oferecem atualizações de desempenho incríveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimização de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que você faz, direcionando potência dinamicamente para onde ela é mais necessária. Os processadores Intel Core da 10ª Geração com memória Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10ª Geração oferecem conectividade cabeada e sem fio rápida, garantida e versátil.\n\nEntretenimento premium \nUma nova arquitetura de gráficos oferece suporte a experiências visuais ultravívidas, como vídeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10 ª Geração com gráficos Intel Iris Plus permitem experiências de entretenimento nunca vistas.\n\nJogos sérios (serious gaming) \nAproveite jogos incríveis com alto FPS, até mesmo enquanto realiza streaming e gravação. Turbo e aceleração da memória Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10ª Geração capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vídeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6),(9,'\\n','R$ 4.499,99','\nPC Gamer Concórdia 32732\n \nEscolhemos um Gabinete Gamer com design bonito e arrojado com frontal com iluminação RGB que certamente trará mais evidência para o seu setup. O PC Gamer Concórdia vem equipado com um poderoso processador Intel Core i5 de 10° Geração que oferece atualizações de desempenho incríveis para melhorar a produtividade, proporcionando entretenimento surpreendente.\n\nCuidadosamente pensado para jogadores de alto nível, o PC Gamer Concórdia possui uma GTX 1650 de 4GB, que fornece um desempenho  para qualquer tarefa ou jogos mais recentes.\n\nQuando o assunto é velocidade, seu SSD de 480GB certamente dará conta do recado, armazene e acesse à todos os seus arquivos e programas em um piscar de olhos. \n','PC Gamer Concórdia Processador Core i5-10400F, RGB, Geforce GTX1650, 8GB, SSD 480GB, Preto - 32726',1);
